&quot;Come Back to Me&quot; is a pop song performed by Vanessa Hudgens, and was the first single from her debut album, V (2006). It samples &quot;Baby Come Back&quot; by the 1970s band Player. The song was first heard on Radio Disney, and it was released to U.S. radio on August 25, 2006 (see 2006 in music). The track was made available at the U.S. iTunes Store on September 12, 2006.

The music video for the song was directed by Chris Applebaum and premiered on August 25, 2006 on Disney Channel immediately following The Cheetah Girls 2 as a way of closing the channel&amp;#039;s &quot;So Hot Summer&quot;. It shows Hudgens dancing and socializing with her friends, including her sister, Stella Hudgens, and Alexa Nikolas from Zoey 101.




